DROP TABLE IF EXISTS `tbl_error_type`;
CREATE TABLE `tbl_error_type` (
  `error_type_id` integer NOT NULL AUTO_INCREMENT,
  `error_type_name` char(128),
  PRIMARY KEY (`error_type_id`)
);

DROP TABLE IF EXISTS `tbl_errors`;
CREATE TABLE `tbl_errors` (
  `error_id` integer NOT NULL AUTO_INCREMENT,
  `error_type` integer,
  `manufactur` integer,
  `error_code` char(5),
  `error_desc` text,
  PRIMARY KEY (`error_id`)
);

DROP TABLE IF EXISTS `tbl_manufacturer`;
CREATE TABLE `tbl_manufacturer` (
  `manufacture_id` integer NOT NULL AUTO_INCREMENT,
  `manufacture_name` char(128),
  `manufacture_logo` char(3),
  PRIMARY KEY (`manufacture_id`)
);

